	add("horsepower", "{\"term\":\"horsepower\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"* From horse and power, the unit originally defined as the amount of power that a horse could provide.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A non-metric unit of power (\u0027symbol\u0027 hp) with various definitions, for different applications. The most common of them is probably the mechanical horsepower, approximately equal to 745.7 watts\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027 March 22nd, David Blockley, \u0027Engineering: w:Very Short A Very Short Introduction\u0027 (309), ISBN 9780199578696, chapter 2: ‚ÄúThe age of gravity ‚Äì time for work‚Äù, page 20\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"In the past, before the widespread adoption of SI units, the work that engines were capable of doing was compared with the work that horses could do ‚Äì hence the term ‚Äò\u0027\u0027horsepower\u0027\u0027‚Äô. Various people came up with various equivalencies, but the modern agreed definition is that 1 \u0027\u0027horsepower\u0027\u0027 is 746 joules per second or 746 watts\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A metric \u0027\u0027horsepower\u0027\u0027 (\u0027symbol\u0027 often PS from the German abbreviation), approximately equal to 735.5 watts\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Strengt\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"political \u0027\u0027horsepower\", \"priority\":6}]}, \"synonyms\":{}}");

